pragma solidity ^0.4.24;

contract Calculator {
    
    uint private lastvalue = 0;

    function Add(uint a, uint b) public returns (uint) {
        lastvalue = a + b;
        return lastvalue;
    }
    
    function Subtract(uint a, uint b) public returns (uint) {
        lastvalue = a - b;
        return lastvalue;
    }

    function Multiply(uint a, uint b) public returns (uint){
        lastvalue = a * b;
        return lastvalue;
    }

    function Divide(uint a, uint b) public returns (uint){
        require (b > 0, "The second parameter should be greater than zero");
        lastvalue = a / b;
        return lastvalue;
    }

    function Exponent(uint a, uint b) public returns (uint){
        lastvalue = a ** b;
        return lastvalue;
    }

    function LastOperation() public constant returns (uint) {
        return lastvalue;
    }
}
